if (msg.payload.filtered_regions)
{
    var set_a_pre = new Set(flow.get("list_a"));
    var set_b_pre = new Set(flow.get("list_b"));
    var set_a = new Set(msg.payload.filtered_regions.Region_A);
    var set_b = new Set(msg.payload.filtered_regions.Region_B);

    var map_all = new Map();
    for (let id of [...set_a_pre, ...set_a_pre]) {
        if (!map_all.has(id)) {
            map_all.set(id, 0);
        }
    }
    for (let [id, misses] of map_all.entries()) {
        if (!set_a.has(id) && !set_b.has(id)) {
            misses += 1;
            map_all.set(id, misses);
            if (misses >= 10) {
                map_all.delete(id);
                if (set_a_pre.has(id)) set_a_pre.delete(id);
                if (set_b_pre.has(id)) set_b_pre.delete(id);
            }
        } else {
            map_all.set(id, 0); // appear, reset counter
        }
    }

    for (let id of set_a_pre) {
        if (!set_a.has(id) && set_b.has(id)) {
            set_a_pre.delete(id);
            flow.set("cnt_a2b", flow.get("cnt_a2b") + 1);
            node.log(flow.get("cnt_a2b"));
        }
    }

    for (let id of set_b_pre) {
        if (!set_b.has(id) && set_a.has(id)) {
            set_b_pre.delete(id);
            flow.set("cnt_b2a", flow.get("cnt_b2a") + 1);
            node.log(flow.get("cnt_b2a"));
        }
    }

    msg.payload.filtered_regions.Region_A.forEach(set_a_pre.add, set_a_pre); 
    msg.payload.filtered_regions.Region_B.forEach(set_b_pre.add, set_b_pre);   
    // set_a_pre.add(msg.payload.filtered_regions.Region_A.slice());
    // set_b_pre.add(msg.payload.filtered_regions.Region_B.slice());
    flow.set("list_a", [...set_a_pre]);
    flow.set("list_b", [...set_b_pre]);
    // flow.set("list_a", msg.payload.filtered_regions.Region_A.slice());
    // flow.set("list_b", msg.payload.filtered_regions.Region_B.slice());

    return [{ payload: flow.get("cnt_a2b") }, { payload: flow.get("cnt_b2a") }];
}
else 
{
    return [null, null];
}

